import React from 'react';
import { ManagementToolNav, SupervisionTable } from '../../../common/components'

import Icon from '@material-ui/core/Icon';
import CircularProgress from '@material-ui/core/CircularProgress';

import Button from 'react-bootstrap/Button';
import ProgressBar from 'react-bootstrap/ProgressBar';

function SupervisionTemplate(props) {
    const { users, navigateDashboard } = props.viewStore;
    return (
        <div>
            <ManagementToolNav />
            <h1>Supervision</h1>
            <h3>Number of unused items: </h3>
            <h3>Number of taken items: </h3>
            <h3>Percentage of taken items: <CircularProgressWithLabel value={45} /></h3>
            {/* <ProgressBar id='progress-bar' animated now={45} /> */}
            <Button variant="btn btn-secondary" onClick={navigateDashboard}><Icon fontSize='large'>keyboard_backspace_outlined</Icon></Button>
            <SupervisionTable users={users} />
        </div>
    )
}

export default SupervisionTemplate;
